            var marker_cluster_4cd7cfccc9887961ae33f74a01b660b5 = L.markerClusterGroup(
                {"tooltips": ["\"\u003cb\u003e\u0412\u043e\u0435\u043d\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0441\u043e \u0441\u043b\u0443\u0436\u0431\u0430\u043c\u0438 \u0410.\u042f.\u0411\u0430\u043b\u0430\u0448\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \u00ab\u0413\u0440\u0430\u043d\u0434\u043e\u0442\u0435\u043b\u044c\u00bb \u041d.\u0424.\u041c\u0430\u043b\u044c\u043d\u0435\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0431\u0430\u043d\u043a\u0430 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0432\u0437\u0430\u0438\u043c\u043d\u043e\u0433\u043e \u043a\u0440\u0435\u0434\u0438\u0442\u0430, 1900-\u0435 \u0433\u043e\u0434\u044b\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 \u043f\u044c\u0435\u0434\u0435\u0441\u0442\u0430\u043b\u0435 \u0441\u0430\u043c\u043e\u043b\u0435\u0442, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432 \u0433\u043e\u0434\u044b \u0443\u0447\u0435\u0431\u044b \u0432 \u043e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u043c \u0432\u044b\u0441\u0448\u0435\u043c \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u043c \u0443\u0447\u0438\u043b\u0438\u0449\u0435 \u043b\u0435\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043b\u0435\u0442\u0447\u0438\u043a-\u043a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442 \u0413\u0430\u0433\u0430\u0440\u0438\u043d \u042e\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0412.\u041f. \u0427\u043a\u0430\u043b\u043e\u0432\u0443\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0434\u043e\u043d\u0430\u043d\u0441-\u0433\u0430\u0443\u0437\u0430, \u0433\u0434\u0435 \u0432 1828 \u0433. \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0438\u0441\u044c \u043f\u043e\u0434 \u0430\u0440\u0435\u0441\u0442\u043e\u043c \u0447\u043b\u0435\u043d\u044b \u0442\u0430\u0439\u043d\u043e\u0433\u043e \u043a\u0440\u0443\u0436\u043a\u0430 \"\"\u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0435 \u0434\u0435\u043a\u0430\u0431\u0440\u0438\u0441\u0442\u044b\"\" \u0438 \u0432 1847 \u0433. - \u0432 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0438 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 \u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e \u0422\u0430\u0440\u0430\u0441 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432 1753-1767 \u0433\u0433. \u0436\u0438\u043b \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0430\u044f, \u043f\u0435\u0440\u0432\u044b\u0439 \u0447\u043b\u0435\u043d-\u043a\u043e\u0440\u0440\u0435\u0441\u043f\u043e\u043d\u0434\u0435\u043d\u0442 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a  \u0420\u044b\u0447\u043a\u043e\u0432 \u041f\u0435\u0442\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u044f ,XIX \u0432.\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432 1920-1924 \u0433\u0433. \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u041a\u0438\u0440\u0433\u0438\u0437\u0441\u043a\u0438\u0439 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0418\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u041a\u043e\u043c\u0438\u0442\u0435\u0442 - \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u041a\u0430\u0437\u0430\u0445\u0441\u043a\u043e\u0439 \u0421\u0421\u0420\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0412.\u0418. \u041b\u0435\u043d\u0438\u043d\u0443\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043c\u044f\u0442\u043d\u043e\u0435 \u043c\u0435\u0441\u0442\u043e, \u0433\u0434\u0435 \u0432 1773 \u0433. \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0430\u0441\u044c \u0441\u0442\u0430\u0432\u043a\u0430 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f \u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0415\u043c\u0435\u043b\u044c\u044f\u043d\u0430 \u041f\u0443\u0433\u0430\u0447\u0435\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0433\u043e \u0432\u044b\u0441\u0448\u0435\u0433\u043e \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u0443\u0447\u0438\u043b\u0438\u0449\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432 1955-1957 \u0433\u0433. \u0443\u0447\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043b\u0435\u0442\u0447\u0438\u043a-\u043a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442 \u0413\u0430\u0433\u0430\u0440\u0438\u043d \u042e\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447.\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0433\u0430\u0443\u043f\u0442\u0432\u0430\u0445\u0442\u044b, \u0441\u0435\u0440. XIX \u0432.\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0412.\u0418. \u041b\u0435\u043d\u0438\u043d\u0443 - \u043e\u0434\u0438\u043d \u0438\u0437 \u043f\u0435\u0440\u0432\u044b\u0445 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u043e\u0432 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435, \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430 \u043e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0445 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0432 1925 \u0433. \u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u044b\u0439 \u0434\u0432\u043e\u0440\u003cb\u003e", "\"\u003cb\u003e\u0423\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043d\u043e\u0439 \u0434\u0438\u0441\u0442\u0430\u043d\u0446\u0438\u0438. 1879-1882 \u0433\u043e\u0434\u044b. \u041f\u0441\u0435\u0432\u0434\u043e\u0433\u043e\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u043a\u0443\u043f\u0446\u0430 \u0412.\u0415. \u041c\u044f\u043a\u0438\u043d\u044c\u043a\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0412\u041d\u0425\u003cb\u003e", "\"\u003cb\u003e\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0435\u0439\u003cb\u003e", "\"\u003cb\u003e\u0421\u043f\u0443\u0441\u043a \u043a \u0440\u0435\u043a\u0435 \u0423\u0440\u0430\u043b\u003cb\u003e", "\"\u003cb\u003e\u041c\u0435\u0441\u0442\u043e \u0437\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u0438\u044f \u0436\u0435\u0440\u0442\u0432 \u0441\u0442\u0430\u043b\u0438\u043d\u0441\u043a\u0438\u0445 \u0440\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0439. 1930-1950 \u0433\u043e\u0434\u044b\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430 \u0441 \u0431\u043e\u0433\u0430\u0442\u044b\u043c \u043b\u0435\u043f\u043d\u044b\u043c \u0434\u0435\u043a\u043e\u0440\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0430\u0432\u043e\u0434 \u0415\u043f\u0430\u0440\u0445\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0432\u0435\u0447\u043d\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435. \u0411\u0430\u0440\u043e\u043a\u043a\u043e\u003cb\u003e", "\"\u003cb\u003e\u0422\u0438\u043f\u0438\u0447\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439  \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0422\u0438\u043f\u0438\u0447\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \u00ab\u0411\u0438\u0440\u0436\u0435\u0432\u0430\u044f\u00bb\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b \u0414\u0435\u0435\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u043f\u0441\u0435\u0432\u0434\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043e\u0441\u043e\u0431\u043d\u044f\u043a \u0441 \u043c\u0435\u0437\u043e\u043d\u0438\u043d\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0431\u044b\u0432\u0448\u0435\u0433\u043e \u043a\u043b\u0443\u0431\u0430 \u0438\u043c\u0435\u043d\u0438 \u041a. \u041c\u0430\u0440\u043a\u0441\u0430, \u0433\u0434\u0435 \u0432 1918-1919 \u0433\u0433. \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u043a\u0440\u0430\u0441\u043d\u043e\u0433\u0432\u0430\u0440\u0434\u0435\u0439\u0441\u043a\u0438\u0435 \u043f\u043e\u043b\u043a\u0438, \u0430 20 \u043c\u0430\u044f 1920 \u0433. \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b I\u2013\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u043a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u0430\u003cb\u003e", "\"\u003cb\u003e\u0423\u0447\u0438\u043b\u0438\u0449\u0435 \u0414\u0443\u0445\u043e\u0432\u043d\u043e\u0435\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \u0411\u044b\u0432\u0448\u0435\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e  \u0411\u0443\u0445\u0430\u0440\u0441\u043a\u043e\u0433\u043e \u044d\u043c\u0438\u0440\u0430. \u0421\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u0435 \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u0430 \u0438 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u0445 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0441\u043a\u0438\u0445 \u043c\u043e\u0442\u0438\u0432\u043e\u0432\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \"\"\u0423\u0440\u0430\u043b\"\". \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439  \u0443\u0441\u0430\u0434\u044c\u0431\u044b \u041a\u0443\u043b\u0430\u043a\u043e\u0432\u0430 \u0414.\u0410. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c, \u043c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c \u0441 \u0431\u0430\u0440\u0430\u0447\u043d\u043e-\u043a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0434\u0435\u043a\u043e\u0440\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \u00ab\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\u00bb \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u043f\u0435\u0440\u0432\u043e\u043c\u0443 \u043a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442\u0443 \u043c\u0438\u0440\u0430 \u042e.\u0410. \u0413\u0430\u0433\u0430\u0440\u0438\u043d\u0443\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c, \u0433\u0434\u0435 \u0432 1919 \u0433. \u0436\u0438\u043b \u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439 I-\u043e\u0439 \u0410\u0440\u043c\u0438\u0435\u0439 \u0413\u0430\u0439 \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447 \u0413\u0430\u0439\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a \u0414.\u041c.\u0411\u0443\u0442\u043e\u043c. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430 \u0441 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0431\u0430\u0440\u043e\u043a\u043a\u043e\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u041f\u0435\u0440\u0432\u0430\u044f \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043c\u0435\u0447\u0435\u0442\u044c\u003cb\u003e", "\"\u003cb\u003e\u0411\u0435\u0441\u0435\u0434\u043a\u0430 \u2013 \u0420\u043e\u0442\u043e\u043d\u0434\u0430 (\u041a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c)\u003cb\u003e", "\"\u003cb\u003e\u0416\u0435\u043d\u0441\u043a\u0430\u044f \u0433\u0438\u043c\u043d\u0430\u0437\u0438\u044f \u041c\u0430\u043c\u0438\u043d\u0430 (\u0447\u0430\u0441\u0442\u043d\u0430\u044f)\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0424.\u041a.\u042d\u0432\u0435\u0440\u0442\u0430 (\u0414\u043e\u043c \u0422\u043e\u0440\u0433\u043e\u0432\u044b\u0439 \"\"\u0413\u0440\u0438\u0435\u0432\u0437 \u0438 \u041a\u00b0\"\"). \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0411\u044b\u0432\u0448\u0430\u044f \u0433\u0438\u043c\u043d\u0430\u0437\u0438\u044f. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435, \u0433\u0434\u0435 \u0432 1919-1920 \u0433\u0433. \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u043b\u0430\u0441\u044c \u0413\u0443\u0431\u0427\u041a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0431\u044b\u0432\u0448\u0435\u0439 \u0418\u043e\u0430\u043d\u043d\u043e-\u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u0445\u043e\u0434\u043d\u044b\u0439 \u0434\u043e\u043c (\u0411\u0430\u043d\u0438)\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u0443\u0441\u0430\u0434\u044c\u0431\u0430. \u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a \u041c.\u0411\u0435\u043a\u0447\u0443\u0440\u0438\u043d\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u041c.\u041d.\u041a\u0430\u043c\u0431\u0443\u043b\u0438\u043d\u043e\u0439. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c.\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0410\u0440\u0445\u0438\u0435\u0440\u0435\u044f\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u043f\u043e\u0440\u0443\u0447\u0438\u043a\u0430 \u041d.\u0410.\u041a\u0440\u0430\u0448\u0435\u043d\u0438\u043d\u043d\u0438\u043a\u043e\u0432\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435, \u0433\u0434\u0435 19 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f 1919 \u0433. \u0432 \u0447\u0435\u0441\u0442\u044c \u043f\u043e\u0431\u0435\u0434\u044b \u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438 \u043d\u0430 \u0422\u0443\u0440\u043a\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u043c \u0444\u0440\u043e\u043d\u0442\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 \u0441 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u0430 \u041a\u0430\u043b\u0438\u043d\u0438\u043d\u0430 \u0438 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\u0430 \u0424\u0440\u0443\u043d\u0437\u0435\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0421\u043e\u044e\u0437\u0430 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u043e\u0432. \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u043e\u0441\u043e\u0431\u043d\u044f\u043a \u0441 \u043f\u0430\u043b\u0438\u0441\u0430\u0434\u043d\u0438\u043a\u043e\u043c. \u041a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u003cb\u003e", "\"\u003cb\u003e\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0441\u043a\u0438\u0439 \u0436\u0435\u043d\u0441\u043a\u0438\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439. 1905 \u0433\u043e\u0434. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0425\u0440\u0430\u043c \u041f\u043e\u043a\u0440\u043e\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0439 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044b. \u0410\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u0430 XIX \u0432.\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435, \u0433\u0434\u0435 \u0432 1941 \u0433. \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u0441\u044f 29 \u043f\u043e\u043b\u043a II  \u043a\u0430\u0432\u0434\u0438\u0432\u0438\u0437\u0438\u0438\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0439. \u041a\u043e\u043d\u0442\u043e\u0440\u0430. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0431\u044b\u0432\u0448\u0435\u0439 \u0446\u0435\u0440\u043a\u0432\u0438 \u0423\u0441\u043f\u0435\u043d\u0438\u044f \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044b\u003cb\u003e", "\"\u003cb\u003e\u041c\u0435\u0447\u0435\u0442\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435. \u041a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u003cb\u003e", "\"\u003cb\u003e\u0421\u0442\u0430\u043d\u0446\u0438\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f\u003cb\u003e", "\"\u003cb\u003e\u0411\u044b\u0432\u0448\u0438\u0439 \u0432\u043e\u0438\u043d\u0441\u043a\u0438\u0439 \u0430\u0440\u0441\u0435\u043d\u0430\u043b (\"\"\u0421\u0442\u0435\u043f\u043d\u043e\u0439 \u0446\u0435\u0439\u0445\u0433\u0430\u0443\u0437\"\"). \u041f\u0441\u0435\u0432\u0434\u043e\u0433\u043e\u0442\u0438\u043a\u0430 \u0441 \u043e\u0431\u043b\u0438\u0446\u043e\u0432\u043a\u043e\u0439 \u043f\u043e\u043b\u0438\u0432\u043d\u044b\u043c \u043a\u0438\u0440\u043f\u0438\u0447\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b \u0412.\u041d.\u0413\u043d\u0435\u0437\u0434\u0438\u043b\u043e\u0432\u0430. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u0443\u0441\u0430\u0434\u044c\u0431\u0430 \u041c.\u041c.\u0422\u0438\u043c\u043e\u0444\u0435\u0435\u0432\u0430. \u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u043a\u0443\u043f\u0446\u0430 \u0410.\u0421.\u0428\u043e\u0448\u0438\u043d\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0428\u0442\u0430\u0431 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043d\u044b\u0439 \u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439. \u0421\u043b\u0443\u0436\u0431\u044b\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0435\u0440\u0430 \u0425\u0443\u0441\u0430\u0438\u043d\u043e\u0432\u0430. \u041d\u0435\u043e\u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u003cb\u003e", "\"\u003cb\u003e\u0422\u0438\u043f\u0438\u0447\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0411\u044b\u0432\u0448\u0438\u0439 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0439. \u041d\u0435\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439 \u043a\u0443\u043f\u0446\u0430 \u0417.\u041b.\u041e\u0431\u0443\u0445\u043e\u0432\u0441\u043a\u043e\u0433\u043e. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u043a\u0443\u043f\u0446\u0430 \u041d.\u0410. \u0421\u043c\u043e\u0447\u0438\u043b\u0438\u043d\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c \u0441 \u043a\u043e\u0440\u0438\u043d\u0444\u0441\u043a\u0438\u043c\u0438 \u0438 \u0434\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u043a\u043e\u043b\u043e\u043d\u043d\u0430\u043c\u0438\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041d\u043e\u043c\u0435\u0440\u0430 \u041f.\u0421.\u041a\u043e\u0440\u043e\u0431\u043a\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u0443\u0441\u0430\u0434\u044c\u0431\u0430 \u0422\u0438\u0442\u0435\u0432\u0430 \u0410.\u0422.\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0423\u0447\u0438\u043b\u0438\u0449\u0435 1-\u0435 \u0412\u044b\u0441\u0448\u0435\u0435 \u041d\u0430\u0447\u0430\u043b\u044c\u043d\u043e\u0435. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a \u0441 \u043c\u0435\u0437\u043e\u043d\u0438\u043d\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u041a\u043e\u043c\u0438\u0441\u0441\u0438\u044f \u043f\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u043d\u0430\u044f\u003cb\u003e", "\"\u003cb\u003e\u0413\u0438\u043c\u043d\u0430\u0437\u0438\u044f \u043c\u0443\u0436\u0441\u043a\u0430\u044f\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0439. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u043a\u0443\u043f\u0446\u0430 \u0424.\u0418.\u041f\u0430\u043d\u043a\u0440\u0430\u0442\u043e\u0432\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041b\u0438\u043a\u0435\u0440\u043e\u0432\u043e\u0434\u043e\u0447\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u041c.\u0413. \u0425\u0443\u0441\u0430\u0438\u043d\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u0443\u0441\u0430\u0434\u044c\u0431\u0430\u003cb\u003e", "\"\u003cb\u003e\u041d\u043e\u0447\u043b\u0435\u0436\u043d\u044b\u0439 \u0434\u043e\u043c \u0418.\u0410. \u0417\u0430\u0440\u044b\u0432\u043d\u043e\u0433\u043e\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435, \u0433\u0434\u0435 \u0441 31.01 \u043f\u043e 5.06.1919 \u0433. \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u043b\u0441\u044f \u0448\u0442\u0430\u0431 \u041a\u0440\u0430\u0441\u043d\u043e\u0439  \u0413\u0432\u0430\u0440\u0434\u0438\u0438\u003cb\u003e", "\"\u003cb\u003e\u041a\u043e\u043d\u0442\u043e\u0440\u0430 \u043f\u043e\u0447\u0442\u043e\u0432\u043e-\u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043d\u0430\u044f. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0421\u0442\u0435\u043b\u0430, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0432 \u0447\u0435\u0441\u0442\u044c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u0432 1743 \u0433\u043e\u0434\u0443 \u0433\u043e\u0440\u043e\u0434\u0430 \u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0430\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0424\u043b\u0438\u0433\u0435\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043a\u0443\u043f\u0446\u0430 \u041f.\u041d.\u041e\u0433\u043b\u043e\u0434\u043a\u043e\u0432\u0430. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043a\u043e\u043b\u044b \u2116 1 (\u041f\u043e\u0437\u0434\u043d\u0438\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c)\u003cb\u003e", "\"\u003cb\u003e\u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c. \u041f\u0443\u0448\u0435\u0447\u043d\u044b\u0439 \u0434\u0432\u043e\u0440. \u041a\u0443\u0437\u043d\u0438\u0446\u0430, \u0431\u0430\u0441\u0442\u0438\u043e\u043d\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430 \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432 \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u0430 \u0438 \u0431\u0430\u0440\u043e\u043a\u043a\u043e\u003cb\u003e", "\"\u003cb\u003e\u0412\u043e\u0434\u043e\u043d\u0430\u043f\u043e\u0440\u043d\u0430\u044f \u0431\u0430\u0448\u043d\u044f. \u00ab\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\u00bb \u0441\u0442\u0438\u043b\u044c. \u041e\u0431\u0440\u0430\u0437\u0435\u0446 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0412\u043e\u0434\u043e\u043d\u0430\u043f\u043e\u0440\u043d\u0430\u044f \u0431\u0430\u0448\u043d\u044f. \u041e\u0431\u0440\u0430\u0437\u0435\u0446 \u043a\u0440\u0443\u043f\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \"\"\u0421\u0430\u043a\u043c\u0430\u0440\u0430\"\", \u0431\u044b\u0432\u0448\u0430\u044f \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \"\"\u0411\u0440\u0438\u0441\u0442\u043e\u043b\u044c\"\". \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e2\u2013\u0435 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u043a\u043b\u0443\u0431\u0430 \u041e\u0440\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0445 \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432, \u0433\u0434\u0435 19-23 \u043c\u0430\u044f 1917 \u0433. \u043e\u0431\u0441\u0443\u0436\u0434\u0430\u043b\u0438\u0441\u044c \u0430\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u0442\u0435\u0437\u0438\u0441\u044b \u0412.\u0418.\u041b\u0435\u043d\u0438\u043d\u0430, \u0432 \u0430\u0432\u0433\u0443\u0441\u0442\u0435 1917 \u0433. \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432\u003cb\u003e", "\"\u003cb\u003e\u041c\u0435\u0447\u0435\u0442\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435. \u041c\u043e\u0434\u0435\u0440\u043d\u003cb\u003e", "\"\u003cb\u003e\u041c\u0435\u043b\u044c\u043d\u0438\u0446\u0430 \u043a\u0443\u043f\u0446\u0430 \u0412.\u0425.\u042e\u0440\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c. \u041c\u043e\u0434\u0435\u0440\u043d \u0441 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u043c \u0434\u0435\u043a\u043e\u0440\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \u041a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043f\u0440\u0438\u043c\u0435\u0440 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438\u003cb\u003e", "\"\u003cb\u003e\u0417\u0430\u0432\u043e\u0434 \u043f\u0438\u0432\u043e\u0432\u0430\u0440\u0435\u043d\u043d\u044b\u0439 \u0410.\u0424.\u041a\u043b\u044e\u043c\u043f\u0430. \u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439 \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u041f\u0438\u0432\u043e\u0432\u0430\u0440\u043d\u044f\u003cb\u003e", "\"\u003cb\u003e\u0421\u0442\u043e\u0440\u043e\u0436\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u041f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043a\u0430\u0437\u0430\u0447\u044c\u0435\u0433\u043e \u0432\u043e\u0439\u0441\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043b\u0430\u0442\u0430 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u0430\u044f. \u041f\u0435\u0440\u0432\u044b\u0439 \u0444\u043b\u0438\u0433\u0435\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u041f\u0430\u043b\u0430\u0442\u0430 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u0430\u044f. \u0412\u0442\u043e\u0440\u043e\u0439 \u0444\u043b\u0438\u0433\u0435\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435. \"\"\u041a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0439\"\" \u0441\u0442\u0438\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0426\u0435\u0440\u043a\u043e\u0432\u044c \u041c\u0438\u0445\u0430\u0439\u043b\u043e-\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0430\u044f\u003cb\u003e", "\"\u003cb\u003e\u0414\u0432\u043e\u0440 \u043f\u043e\u0441\u0442\u043e\u044f\u043b\u044b\u0439 \u0415.\u0410. \u0420\u0430\u0434\u0443\u0448\u0435\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u041e\u0441\u043e\u0431\u043d\u044f\u043a. \u041c\u043e\u0434\u0435\u0440\u043d. \u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0440\u043e\u0434\u0438\u043b\u0441\u044f \u0410.\u0418. \u0411\u0435\u0440\u0433. \u0425I\u0425 \u0432. \u042d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430.\u003cb\u003e", "\"\u003cb\u003e\u0417\u0434\u0430\u043d\u0438\u0435 \u0410\u0437\u043e\u0432\u043e-\u0414\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u0431\u0430\u043d\u043a\u0430\u003cb\u003e", "\"\u003cb\u003e\u0421\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0435\u043e\u0440\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0430\u044f\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0443\u0441\u0430\u0434\u044c\u0431\u044b \u0410.\u0410. \u0421\u0430\u0437\u043e\u043d\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u041f\u0440\u0438\u044e\u0442 \u0440\u043e\u0434\u0438\u043b\u044c\u043d\u044b\u0439\u003cb\u003e", "\"\u003cb\u003e\u0411\u0430\u043d\u043a \u0412\u043e\u043b\u0436\u0441\u043a\u043e-\u041a\u0430\u043c\u0441\u043a\u0438\u0439\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0434\u043b\u044f \u0432\u044b\u0441\u0448\u0435\u0433\u043e \u043e\u0444\u0438\u0446\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0426\u0435\u0440\u043a\u043e\u0432\u044c \u041f\u043e\u043a\u0440\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u0410.\u0412. \u0421\u043e\u043a\u043e\u043b\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u0434\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0421\u043b\u0443\u0436\u0431\u044b\u003cb\u003e", "\"\u003cb\u003e \u0414\u043e\u043c \u0422\u0438\u043c\u0430\u0448\u0435\u0432\u044b\u0445 (\u0437\u0434\u0435\u0441\u044c \u0431\u044b\u0432\u0430\u043b\u0438 \u0410.\u0421. \u041f\u0443\u0448\u043a\u0438\u043d, \u0412.\u0410. \u0416\u0443\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u0412.\u0418. \u0414\u0430\u043b\u044c, \u0410. \u0410\u043b\u044f\u0431\u044c\u0435\u0432, \u0410.\u041a. \u0422\u043e\u043b\u0441\u0442\u043e\u0439, \u0410.\u041c. \u0416\u0435\u043c\u0447\u0443\u0436\u043d\u0438\u043a\u043e\u0432, \u0410.\u041d. \u041f\u043b\u0435\u0449\u0435\u0435\u0432 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0432\u0438\u0434\u043d\u044b\u0435 \u0434\u0435\u044f\u0442\u0435\u043b\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b)\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u0413. \u0428\u043e\u043b\u044f\u003cb\u003e", "\"\u003cb\u003e\u0421\u043b\u0443\u0436\u0431\u044b \u0445\u043e\u043b\u043e\u0434\u043d\u044b\u0435\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0441 \u043b\u0430\u0432\u043a\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0416\u0438\u043b\u043e\u0439 \u0434\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0412.\u0418. \u0414\u0430\u043b\u044f, \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044f \u00ab\u0422\u043e\u043b\u043a\u043e\u0432\u043e\u0433\u043e \u0441\u043b\u043e\u0432\u0430\u0440\u044f \u0436\u0438\u0432\u043e\u0433\u043e \u0432\u0435\u043b\u0438\u043a\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u044f\u0437\u044b\u043a\u0430\u00bb\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u0418.\u0413. \u0421\u043a\u0432\u043e\u0440\u0446\u043e\u0432\u0430\u003cb\u003e", "\"\u003cb\u003e\u0424\u043b\u0438\u0433\u0435\u043b\u044c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u0445\u043e\u0434\u043d\u044b\u0439 \u0434\u043e\u043c\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0441 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u0430\u043c\u0438\u003cb\u003e", "\"\u003cb\u003e\u0423\u0441\u0430\u0434\u044c\u0431\u0430 \u041d.\u0410. \u0421\u043c\u043e\u0447\u0438\u043b\u0438\u043d\u0430\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e", "\"\u003cb\u003e\u0414\u043e\u043c \u0436\u0438\u043b\u043e\u0439\u003cb\u003e"]}
